import React from 'react';
import { View, Text, StyleSheet } from 'react-native';
import ProfileIcon from './ProfileIcon'; // Import your ProfileIcon component

export default function ProfileScreen({ route }) {
  const { username } = route.params; // Access the username from route.params

  return (
    <View style={styles.container}>
      <Text style={styles.title}>User Profile</Text>
      {/* Other profile content */}
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'white',
    padding: 20,
    alignItems: 'center',
  },
  title: {
    fontSize: 24,
    fontWeight: 'bold',
    marginBottom: 20,
  },
  // Other styles for your profile content
});
